import numpy as np
import math


class Binary(object):
    def __init__(self):
        self.vt = 0
        self.m = 0
        self.p = []

    def Binary_Search_Identification(self, Nt):
        """ 利用二分搜索的思想，递归的对Nt进行二分识别，直至找出所有非法签名后停止
        """
        print(Nt)
        # if len(Nt) == 0:
        #     print("BSI算法结束时的总验证次数为", self.vt)
        #     print("BSI算法结束时的总轮次为", self.m)
        #     return 0

        if np.sum(Nt) == 0 or len(Nt) == 1:
            # self.p.append(0)
            self.vt = self.vt + 1

        else:
            self.vt = self.vt + 1
            low = 0
            high = len(Nt)
            mid = math.ceil((low + high) / 2)
            Left_Nt = Nt[low:mid]
            Rigt_Nt = Nt[mid:high]
            # self.p.append(2)
            self.Binary_Search_Identification(Left_Nt)
            self.Binary_Search_Identification(Rigt_Nt)


